import React  from 'react';
import web from "../src/Images/logo.jpg"
import { NavLink } from 'react-router-dom';

const Call = () =>{
    
    return( 
    <>
     <div className="media">
  <div className="media-body">
    <h2 className="mt-1 mb-1 align-text-top"><strong>Headline</strong></h2>
    Cras sit amet nibh libero, in gravida nulla. Nulla vel metus scelerisque ante sollicitudin. Cras purus odio, vestibulum in vulputate at, tempus viverra turpis. Fusce condimentum nunc ac nisi vulputate fringilla. Donec lacinia congue felis in faucibus.
  </div>
  <img src={web} className="ml-3 " alt="img"/>
</div>
     
<div>
<NavLink to="/about" className="btn btn-primary">Show all Products</NavLink>
</div>
    </>);
};
export default Call;
